import logo from './logo.svg';
import './App.css';
import Rajesh from './Rajesh.js';
import Header from './Header.js';
import Content from './Content.js';


function App() {
  function selectLang(){
    let langs=['React','Angular','Vue'];
    let randint=Math.floor(Math.random()*3);
    return langs[randint];
  }
  return (
    <div className="App">
          <Header />
          <Content />

          Learn {selectLang()}
    </div>
  );
}

export default App;
